## Task
Generate a SQL query to answer the following question:
Show the date of the transcript which shows the least number of results, also list the id.

### Database Schema
This query will run on a database whose schema is represented as:
CREATE TABLE Transcripts (
  transcript_id NUMBER,
  transcript_date TIME,
  other_details TEXT
);

CREATE TABLE Transcript_Contents (
  student_course_id NUMBER,
  transcript_id NUMBER
);

CREATE TABLE Semesters (
  semester_id NUMBER,
  semester_name TEXT,
  semester_description TEXT,
  other_details TEXT
);

CREATE TABLE Degree_Programs (
  degree_program_id NUMBER,
  department_id NUMBER,
  degree_summary_name TEXT,
  degree_summary_description TEXT,
  other_details TEXT
);

CREATE TABLE Courses (
  course_id NUMBER,
  course_name TEXT,
  course_description TEXT,
  other_details TEXT
);

CREATE TABLE Student_Enrolment_Courses (
  student_course_id NUMBER,
  course_id NUMBER,
  student_enrolment_id NUMBER
);

CREATE TABLE Departments (
  department_id NUMBER,
  department_name TEXT,
  department_description TEXT,
  other_details TEXT
);

-- Transcript_Contents.transcript_id = Transcripts.transcript_id
-- Transcript_Contents.student_course_id = Student_Enrolment_Courses.student_course_id
-- Degree_Programs.department_id = Departments.department_id

### SQL
Given the database schema, Write only the SQL query that answers the question:
 SELECT t.transcript_date, t.transcript_id FROM Transcripts t JOIN Transcript_Contents tc ON t.transcript_id = tc.transcript_id GROUP BY t.transcript_date, t.transcript_id ORDER BY COUNT(tc.student_course_id) ASC LIMIT 1;

