## Task
Generate a SQL query to answer the following question:
What are the names of the countries with no car makers?

### Database Schema
This query will run on a database whose schema is represented as:
CREATE TABLE car_names (
  MakeId NUMBER,
  Model TEXT,
  Make TEXT
);

CREATE TABLE countries (
  CountryId NUMBER,
  CountryName TEXT,
  Continent NUMBER
);

CREATE TABLE car_makers (
  Id NUMBER,
  Maker TEXT,
  FullName TEXT,
  Country TEXT
);

CREATE TABLE continents (
  ContId NUMBER,
  Continent TEXT
);

CREATE TABLE model_list (
  ModelId NUMBER,
  Maker NUMBER,
  Model TEXT
);

-- car_names.Model = model_list.Model
-- countries.Continent = continents.ContId
-- car_makers.Country = countries.CountryId

### SQL
Given the database schema, Write only the SQL query that answers the question:
 SELECT c.CountryName FROM countries c LEFT JOIN car_makers cm ON c.CountryId = cm.Country WHERE cm.Country IS NULL ORDER BY c.CountryName NULLS LAST;

